import s from "./SingleUser.module.css";
import { NavLink } from "react-router-dom";

const SingleUser = (props) => {
  debugger;
  let path = "/chat/" + props.id;
  let messages = props.messages.map((m) => {
    return (
      <div>
        <div>{m.message}</div>
        <div>{m.date}</div>
      </div>
    );
  });
  return (
    <div
      className={s.singleUserWrapper}
      onClick={() => props.setCurrentChat(props.name, props.id, props.messages)}
    >
      <NavLink to={path}>
        <div>
          {props.name} <span>{props.date}</span>
        </div>
        <div>{props.lastMessage}</div>
      </NavLink>
    </div>
  );
};

export default SingleUser;
